import React from 'react';
import {
  MDBInput,
  MDBCol,
  MDBRow,
  MDBCheckbox,
  MDBBtn,
  MDBIcon
} from 'mdb-react-ui-kit';
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';

// <MDBInput id='form3Example1' label='First name' />
// <MDBIcon fab icon='facebook-f' />
export default function Contact() {
  return (
    <section className ='contact-section d-flex align-items-center justify-content-center ' >
        <Container fluid >

          <Row>
            <Col className='align-self-center align-items-center justify-content-center'>

            <h1>Contact Me !</h1>
            <form>
            <MDBInput className ='form-input' label='First name' /><br />
            <MDBInput className ='form-input' label='Last name' /><br />
            <MDBInput className='mb-4' type='email' id='form3Example3' label='Email address' />
            
            </form>
            </Col>
            <Col>
            
            </Col>
          </Row>
          

          

        </Container>
    </section>
   
  );
}
